def sum (temp: int) -> int:
    sum = 0;
    temp = int(temp)
    while (temp > 0):
        sum  = sum + (temp%10)**2
        temp = temp // 10
    return sum
    
def isHappy(n: int) -> bool:
    a = n

    while(n != 1):
        print(n)
        if(n < 10):
            return False
        a = n
        n = sum(n)
        
    return True
        
